import React from "react";
import "../CSS/Info.css";

function Info({ invoiceNo, recipient, itemName }) {
  return (
    <div className="info">
      <div>운송장 번호: {invoiceNo}</div>
      <div>받는 사람: {recipient}</div>
      <div>수령 주소: {recipient}</div>
      <div>주문 상품: {itemName}</div>
    </div>
  );
}
export default Info;
